법령 및 지침에 지급(지출) 근거가 없음에도 불구하고, 2016년 4월부터 2018년 7월까지 23회에 걸쳐 총 113,100,000원을 사유재산 이용료 명목으로 설립자 명의 계좌로 이체한 사실이 있음
