다. 시설적립금 임의 적립
수익형 보험(연금보험)에 13년(2015년~2028년) 납기로 가입하여 유치원회계에서 매월 5,000,000원씩 29회에 걸쳐 총145,000,000원의 시설적립금을 임의 적립한 사실이 있음');
또한 2018학년도 메이플유치원 예산서의 총괄현황 상 인건비를 예산 초과하여 집행하였음',null,null,null,null,'2016.3.~2018.11. 기간 동안 체육활동 등 각종 용역계약에 따른 월별 대금을 지급하면서 공급자(용역 계약자)가 제출한 사업자등록증에 부가가치세 면제 대상이  아닌 일반과세 대상으로 명시되어 있음에도 부가가치세 절감 목적으로 세금계산서를 발급받지 아니하고 거래내역서만 제출받아 용역대금을 지급하였고, 2018.12. 감사일 현재까지 매입처별 세금계산서 합계표를 납세지 관할 세무서장에게 제출(신고)하지 않았음','2018년도에 집행한 ‘유치원 데크 연장 공사’외 2건의 공사가 선금지급 신청일 기준으로 계약 이행기간이 30일을 초과하지 않아 선금 지급 대상이 되지 않음에도 채권도 확보하지 않은 채 선금 총 11,350,000원을 지급하였음
2018. 7. 21.(주)○○○○○와 계약하여 집행한 ‘유치원 방수 및 도장 공사’에 대하여 시공자가 당초 제출한 공사 범위와 실제 시공 내역이 상이하거나 시공하지 않았음에도 불구하고 시정을 요구하거나 변경내역서를 제출받지 않았음',null);
31회에 걸쳐 총 122,000,000원을 설립자 명의 계좌로 이체한 사실이 있음"','"1. 방과후 특성화프로그램 운영 부적정
전체 유아를 대상으로 13:00~14:30까지 특성화프로그램(영어, 중국어, 음악, 체육, 미술, 태권도, 수영)을 운영하면서 학부모 수요 조사를 실시하지 않고 교육과정 시간 내 특성화 프로그램을 운영하였으며, 설립자 소유의 인근 영어 학원으로 원아들을 이동시켜 15:05~15:45까지 특성화 프로그램을 실시하는 등 유아들에게 1인당 1일 2개 프로그램을 운영하였다. 또한 특성화프로그램 연간운영계획서와 활동안을 작성하지 않았고, 강사와 계약서 작성 시 횟수, 비용 등을 명시하지 않았으며 강사 복무관리를 소홀함',null,'유치원 원아들의 생활기록부를 작성하면서 대장번호, 출결 및 신체발달상황 등에 관한 작성을 소홀함','2011년 개원 이래 퇴직급여제도를 설정하지 않았으며, 따라서 계속근로기간 1년에 대하여 30일분 이상의 평균임금을 퇴직금으로 퇴직 근로자에게 지급할 수 있는 퇴직금제도를 설정하고 소요액 계상, 적립 현황 보고, 퇴직금 적립 등의 절차를 이행하여야 함에도 불구하고 교직원 23명에 대하여 퇴직금을 적립하지 않은 사실이 있음',null,'2016년 1월 시설 증축공사 후 관할청의 변경 인가를 받지 않은 채로 사무실 또는 교실 용도로 사용(1층 사무실 18㎡, 2층 교실 28.5㎡)한 사실이 있음','"1. 계좌,카드 개설 및 수납.지출업무 처리 부적정
지출원 명의가 아닌 설립자 명의로 계좌를 개설한 후 설립자가 수납·지출 업무를 처리하였고, 지출 과정에서는 기관 명의 카드를 개설·사용하지 않고 설립자 개인카드를 사용한 후 유치원회계에서 해당 금액을 설립자에게 지급한 사실이 있음
2. 회계 관련 증빙서류 보존.관리 부적정
2016학년도부터 감사일 현재까지 지출 목적, 수량, 내역 등을 확인할 수 있는 자료(품의서, 견적서, 계약에 관한 증빙서류 등)없이 세출예산을 집행하여 지출원인행위 또는 청구가 정당한지 확인할 수 없도록 하였고, 계좌입금 방법으로 처리한 지출건의 경우에는 세금계산서·계산서 등의 청구서, 금융회사외 거래실적을 입증하는 무통장 입금증을 보존·관리하지 않은 사실이 있음"');
거래업체에게 물품, 용역 구입 등으로 발급받은 매입처별 세금계산서(계산서)합계표를 관할 세무서에 신고한 사실이 없음
2. 회계 관련 증빙서류 보존 및 관리 부적정,
다수의 회계 관련 증빙서류(세금계산서, 청구서, 견적서, 무통장 입금증 등)를 보존·관리하고 있지 않은 사실이 있음','변경인가 신청 없이 2016. 2. 22.에 인가받을 당시 제출한 평면도 상 1층의 교실-3(48.24㎡) 중간을 벽으로 분리하여 현재 교실-이슬반(29.89㎡)과 별도실(15.16㎡)로 사용하고 있는 사실이 있음',null);
