Insert into MOMSMAP.KINDERINFO (KINDERINFOID,OFFICEEDU,SUBOFFICEEDU,KINDERNAME,ESTABLISH,EDATE,ODATE,ADDR,TELNO,HPADDR,OPERTIME,CLCNT3,CLCNT4,CLCNT5,MIXCLCNT,SHCLCNT,PPCNT3,PPCNT4,PPCNT5,MIXPPCNT,SHPPCNT,POINT_Y,POINT_X,TOTAL,BAD_OPER,BAD_PROGRAM,BAD_MEAL,BAD_CARE,BAD_EMP,BAD_TAX,BAD_BUILD,BAD_MONEY) values ('KR019','서울특별시교육청','남부교육지원청','정훈유치원','사립(사인)',19990601,19990601,'서울특별시 구로구 경인로 382','02-2683-6833',null,'09시00분~19시00분',1,2,2,0,null,23,46,50,0,1,126.8619507,37.49455816,'89.5','예산안(2016학년도, 2017학년도), 결산안(2016학년도), 방과후특성화사업(2017학년도), 인성교육계획, 안전교육계획(2016~2018학년도)에 대해 운영위원회에 자문받지 않았고, 2018학년도 예산안은 사후자문을 받았음',null,null,null,'교직원 채용시 2016년 3명, 2017년 3명, 2018년 1명 건강진단서를 미징구, 2016년 3명, 2017년 1명, 2018년 2명 범죄전력조회를 미실시하였고, 2016~2018학년도 000과 계약을 체결하면서 담당업무를 명시하지 않은 채 계약서를 작성하였음','2016학년도부터 2018학년도에 세출예산으로 사유재산 공적이용료를 부당편성한 후 유치원 사유재산 공적이용료로 7,200,000원을 지출하였다가 유치원회계로 2회에 걸쳐 반납하였음','교육지원청의 승인절차를 거치지 않고, 1층 1개 교실의 면적을 13.41㎡확장하였고 3층에는 강당, 창고, 공유면적으로 109.05㎡를 무단으로 증축하였음','2016년 3월부터 2018년 11월 감사일 현재까지 지출품의서를 작성하지 않았고, 50만원이상 지출 411건에 대해 회계 관련 증빙서류의 일부 또는 전부를 누락하였고, 보수의 경우 산출내역 미첨부, 방과후 특성화비의 지출품의서 및 지출결의서를 미작성하였으며, 2017학년도 기관운영비, 2018학년도 일반업무추진비에서 00대학으로 기부금 총2,000,000원을 예산 목적 외로 집행하였음');
Insert into MOMSMAP.KINDERINFO (KINDERINFOID,OFFICEEDU,SUBOFFICEEDU,KINDERNAME,ESTABLISH,EDATE,ODATE,ADDR,TELNO,HPADDR,OPERTIME,CLCNT3,CLCNT4,CLCNT5,MIXCLCNT,SHCLCNT,PPCNT3,PPCNT4,PPCNT5,MIXPPCNT,SHPPCNT,POINT_Y,POINT_X,TOTAL,BAD_OPER,BAD_PROGRAM,BAD_MEAL,BAD_CARE,BAD_EMP,BAD_TAX,BAD_BUILD,BAD_MONEY) values ('KR028','서울특별시교육청','남부교육지원청','바니유치원','사립(사인)',19900306,19900306,'서울특별시 구로구 구일로4길 46','02-865-4234',null,'09시00분~17시30분',1,1,1,0,null,28,29,25,0,1,126.8776998,37.49234372,'104.5','공립유치원 교원 보수 수준 이상 급여 지급받는 자',null,null,null,'교직원을 채용하면서 2016년 4명, 2017년 4명, 2018년 4명에 대해 건강진단서를 징구하지 않은 채 계약을 체결하였음',null,null,'엄마품온종일돌봄교실 운영과 관련하여 유치원 명의 예금계좌로 관리하면서 2017.8.22.~2018.11월 감사일 현재까지 유치원회계로 편입하지 않고 별도로 운영하였고, 2017.3.31. 학부모부담금 23,310,000원을 별도계좌로 입금 후 2017.5.8.까지 17,281,970원을 직접 지출 처리하였으며 2017.4.3.에 8,358,588원을 유치원회계통장으로 이체하여 유치원회계에 편입하였음');
Insert into MOMSMAP.KINDERINFO (KINDERINFOID,OFFICEEDU,SUBOFFICEEDU,KINDERNAME,ESTABLISH,EDATE,ODATE,ADDR,TELNO,HPADDR,OPERTIME,CLCNT3,CLCNT4,CLCNT5,MIXCLCNT,SHCLCNT,PPCNT3,PPCNT4,PPCNT5,MIXPPCNT,SHPPCNT,POINT_Y,POINT_X,TOTAL,BAD_OPER,BAD_PROGRAM,BAD_MEAL,BAD_CARE,BAD_EMP,BAD_TAX,BAD_BUILD,BAD_MONEY) values ('KN004','서울특별시교육청','강남서초교육지원청','도곡렉슬유치원','사립(사인)',20060221,20060306,'서울특별시 강남구 선릉로 221','02-579-7736',null,'09시00분~18시00분',null,null,null,8,null,null,null,null,184,null,127.0498811,37.4928605,'105','2016학년도부터 2018년 11월 감사일 현재까지 유치원 생활기록부 내부결재를 받은 자료가 없는 등 작성 및 유지, 보존 업무를 부적정하게 처리함','2016~2018학년도 감사일 현재까지 교육과정운영 시간에 연령별로 매주 1번씩 체육 특성화 활동을 진행하는 등 교육과정운영 시간 내 특성화활동을 부적정하게 운영함','2016. 3월부터 감사일 현재까지 집단급식소 식품판매업체인 ㈜**키즈에서 매일 식자재가 들어왔음에도 유치원 식단과 무관한 소량의 “과일, 샌드위치, 커피, 샐러드, 빵”등을 급식운영비에서 총 금8,435,280원을 부적정하게 집행함','2016학년도부터 2018년 11월 감사일 현재까지 유치원 생활기록부 내부결재를 받은 자료가 없는 등 작성 및 유지, 보존 업무를 부적정하게 처리함','2016년 방과후 특성화프로그램을 운영하면서 원아 1인당 월 50,000원의 부담금을 받고 강사비로 1,300,000원*4명을 지급할 것을 자문 받았으나, 실제로는 원아 1인당 월 50,000원을 받고 강사비로 1인당 1,200,000원을 지급하였고, 2016학년도에 채용된 강사 4명 중 1명의 계약서만 작성하면서 계약 금액을 표기하지 않음','2016년부터 2018년 6월까지 일반과세사업자로부터 교재 등을 구입한 후 발급받은 세금계산서(계산서) 총192건(총 642,899,446원)에 대해 관할 세무서에 매입처별 세금계산서(계산서)합계표를 해당 예정신고 또는 확정 신고 할 때 함께 제출하지 않음','유치원 주소지와 “사단법인 ***몬테소리교육연구소” 사업자등록주소지를 병행하여 사용하고, 유치원 시설 내 원장실 및 교육시설 지하 1층 강당을 ***몬테소리교육연구소 강의 장소로 사용한 사실이 있음','1. 퇴직금적립통장을 2개 운영하면서 기존통장 거래내역을 제출하지 않아 감사대상 기간인 2016. 3. 1.부터 2018. 1. 9.까지 퇴직금 적립현황을 확인할 수 없으며, 퇴직적립금 통장을 새 통장으로 이관하면서 8,111,245원 부족하게 이체하였음 
