Insert into MOMSMAP.KINDERINFO (KINDERINFOID,OFFICEEDU,SUBOFFICEEDU,KINDERNAME,ESTABLISH,EDATE,ODATE,ADDR,TELNO,HPADDR,OPERTIME,CLCNT3,CLCNT4,CLCNT5,MIXCLCNT,SHCLCNT,PPCNT3,PPCNT4,PPCNT5,MIXPPCNT,SHPPCNT,POINT_Y,POINT_X,TOTAL,BAD_OPER,BAD_PROGRAM,BAD_MEAL,BAD_CARE,BAD_EMP,BAD_TAX,BAD_BUILD,BAD_MONEY) values ('SC008','서울특별시교육청','강남서초교육지원청','영유유치원','사립(사인)',19860301,19860303,'서울특별시 서초구 효령로34길 72','02-586-7516',null,'09시00분~18시00분',1,2,2,0,null,15,20,27,0,1,127.0007517,37.4786401,null,'2016년 3월부터 2017년 10월까지 총 지출 건수 2,532건(100%)의 지출증빙서에 회계 증빙자료(영수증, 세금계산서 등) 일체가 구비되어 있지 않고, 2018년 8월~11월(4개월분 표집 검토) 지출증빙서에는 지출건수 총 495건 중 205건(41%)의 회계 증빙자료가 미비하여 예산 집행의 적정성 여부를 확인할 수 없음',null,null,'2016~2018학년도 감사일 현재까지 유치원 생활기록부를 내부결재 받지 않고, 출력물로 편철하지 않았으며, 별도로 CD에 보관하고 있지 않은 등 생활기록부 작성 및 관리업무를 소홀히 함',null,'2016년부터 2018년 6월까지 일반과세업자로부터 교재 등을 구입한 후 세금계산서(계산서) 총 415건, 금280,247,968원에 대해 관할 세무서에 매입처별 세금계산서(계산서) 합계표를 제출하지 않음','설립 인가를 받지 않은 유치원 내 1층 노유자시설(영유아 보육시설)을 오후 방과후프로그램 교육활동 장소로 사용함',null);
Insert into MOMSMAP.KINDERINFO (KINDERINFOID,OFFICEEDU,SUBOFFICEEDU,KINDERNAME,ESTABLISH,EDATE,ODATE,ADDR,TELNO,HPADDR,OPERTIME,CLCNT3,CLCNT4,CLCNT5,MIXCLCNT,SHCLCNT,PPCNT3,PPCNT4,PPCNT5,MIXPPCNT,SHPPCNT,POINT_Y,POINT_X,TOTAL,BAD_OPER,BAD_PROGRAM,BAD_MEAL,BAD_CARE,BAD_EMP,BAD_TAX,BAD_BUILD,BAD_MONEY) values ('NW036','서울특별시교육청','북부교육지원청','한성유치원','사립(사인)',19930301,19930301,'서울특별시 노원구 한글비석로 145','02-974-8872','http://www.한성유치원.com','09시30분~18시00분',2,4,3,0,null,72,84,78,0,2,127.0759778,37.6405835,'93','2016학년도부터 감사일 현재까지 지출결의서를 작성·관리하면서 계좌입금 방법으로 처리한 지출건에 대하여 세금계산서·계산서 등의 청구서와 견적서, 계약서, 금융회사외 거래실적을 입증하는 무통장 입금증, 공사관련 필수 서류(설계·계약·준공 관련 서류) 등 회계관련 증빙서류 일부를 보존·관리하지 않은 사실이 있음','2017학년도부터 감사일 현재까지 유치원 가정통신문에 설립자 명의 유아두뇌발달연구소의 스페셜클래스(요가, 논술동화, 피아노 등)와 영어집중반의 특기활동을 안내하고 유치원 방과후과정 종일제특성화 영어, 체육, 음악 외의 추가 특성화 활동을 유치원과 설립자 명의 예절관에서 유아들에게 원아 1인당 1일 1개, 1시간 이내 기준을 초과하여 부적정하게 실시한 사실이 있음. 또한 2016학년도부터 감사일 현재까지 전체 유아를 대상으로 영어, 음악, 체육 특성화 프로그램을 운영하면서 과목별 개인동의서를 통한 학부모들의 수요조사를 실시하지 않고 부적정하게 운영한 사실이 있음','가. 영양사 근무사항 관리 소홀
