Insert into MOMSMAP.KINDERINFO (KINDERINFOID,OFFICEEDU,SUBOFFICEEDU,KINDERNAME,ESTABLISH,EDATE,ODATE,ADDR,TELNO,HPADDR,OPERTIME,CLCNT3,CLCNT4,CLCNT5,MIXCLCNT,SHCLCNT,PPCNT3,PPCNT4,PPCNT5,MIXPPCNT,SHPPCNT,POINT_Y,POINT_X,TOTAL,BAD_OPER,BAD_PROGRAM,BAD_MEAL,BAD_CARE,BAD_EMP,BAD_TAX,BAD_BUILD,BAD_MONEY) values ('JR009','서울특별시교육청','동부교육지원청','윤경유치원','사립(사인)',19961011,19961105,'서울특별시 중랑구 숙선옹주로 91','02-3421-7184',null,'09시30분~20시00분',2,2,2,0,null,34,51,49,0,2,127.0854748,37.61648267,null,'2016.3.1.부터  2018년 감사일 현재까지 유치원 회계 예산을 집행하면서 세금계산서․계산서 등의 청구서와 견적서, 품의요구서 등과 공사관련 필수 서류인 사업자등록증,전문면허증, 국세․지방세 납세증명서, 설계서 등 일부의 회계 관련 증빙서류를 보존․관리하고 있지 않음. 또한, 교수학습활동비, 복리후생비 예산에서 업무추진비성 경비인 교직원 명절선물구입비 금8,450,000원(2건)을 목간 혼용하여 집행한 사실이 있음',null,null,'2015학년도 유치원생활기록부를 기재하면서 만3세 원아 17명의 3세 유차발달상황 입력을 누락한 사실이 있음','2016~2018학년도에 교직원 복지 및 유치원 통학차량 구입 명목으로 금12,000,000원을 유치원회계에서 설립자 명의의 금융계좌로 적립하여 보관하고 있다가, 감사실시 전 유치원회계 계좌로 보관금액 전액을 반환한 사실이 있음','2016~2017학년도까지 유치원 교재 등을 구입하면서 일반과세 사업자로부터 발급받은 세금계산서(계산서) 총41건(금73,720,000원)에 대해 매입처별 세금계산서(계산서)합계표를 해당 예정신고 또는 확정신고 할 때 미제출함','2018학년도에 1천5백만 원 이상의 공사 2건을 집행하면서 전문건설업면허를 보유하지 않은 업체와 계약을 체결·집행한 사실이 있음','2016~2018학년도에 유치원 연합회비 목적으로 총11회(금6,030,000원), 유치원 업무 목적으로 교직원 개인 차량 주유 총4회(금293,000원), 학부모 출산 화분, 유치원 통학차량 주차 과태료, 기부금 등으로 총10회(금4,003,100원)을 유치원 회계에서 지출하였고, 특정감사 실시 전 유치원 연합회비 금6,030,000원 중 금5,160,000원과 교직원 개인 차량 주유비 금293,000원을 유치원회계 계좌로 반환한 사실이 있음');
